import React from 'react';
import ReactDOM from 'react-dom/client';

function Car(hueii) {
        return <p>Buy this {hueii.color}car now!</p>;
}

const header = (<div>
<header>
<h1>Fi$Pond</h1>
    <p style={{paddingRight: "5em", color: "red"}}>Your Solution, our catalog</p>
    <br/>
    <span>
        <Car color="moon"/>
    </span>
</header>
</div>);

const usere = header;
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(usere);
